import React from "react";
import "./Viewport.scss";

function Viewport(props) {
  console.log(props);

  function mouseDownHandler() {}

  return (
    <div className="viewport-container" onMouseDown={mouseDownHandler}>
      {props.src.map((imgUrl) => {
        return <img id={imgUrl} src={imgUrl} alt="Design Section" />;
      })}
    </div>
  );
}

export default Viewport;
